import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click a category to show the product list and view controls
    await page.locator('.category-card').filter({ hasText: 'Electronics' }).click();

    // Wait for the view toggle buttons to be visible
    await page.waitForSelector('.view-toggle', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_view.png'));

    // 2. Find and click the "List View" button
    const listViewButton = page.getByRole('button', { name: 'List View' });
    await listViewButton.click();

    // 3. Wait for the product container to switch to list view mode
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // 4. Extract data to verify the switch
    const isListViewActive = await listViewButton.evaluate(node => node.classList.contains('active'));
    const productViewContainerClass = await page.locator('.products-list').getAttribute('class');

    return {
      success: true,
      action: "Switched product view to List Mode",
      extractedData: {
        isListViewActive: isListViewActive,
        productViewContainerClass: productViewContainerClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
